import './App.css';
import React from 'react';
import Page2 from './pages/page2';
import Page3 from './pages/Page3';
import Page4 from './pages/Page4';
import Page5 from './pages/page5';


function App() {
  return (
    <div className="App">
      <Page1 />
      <Page2 />
      <Page3/>
      <Page4/>
      <Page5/>
    </div>
  );
}

export default App;
